package org.openmainframeproject.tersedecompress;

import java.io.BufferedInputStream;
import java.io.BufferedOutputStream;
import java.io.ByteArrayOutputStream;
import java.io.DataInputStream;
import java.io.DataOutputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;
import java.io.RandomAccessFile;

abstract class TerseDecompresser implements AutoCloseable
{
	TerseBlockReader input;
	ByteArrayOutputStream record;
	DataOutputStream stream;

	boolean HostFlag; 
	boolean TextFlag;
	boolean VariableFlag;

    long         OutputTotal   = 0    ; /* total number of bytes                    */
    int         RecordLength; /* host perspective record length           */

    byte[] lineseparator = System.lineSeparator().getBytes();

    public abstract void decode() throws IOException;

    public TerseDecompresser(InputStream instream, OutputStream outputStream, TerseHeader header, boolean textFlag)
	{		
		this.RecordLength = header.RecordLength;
		this.HostFlag = header.HostFlag; 
		this.VariableFlag = header.RecfmV;
		this.input = new TerseBlockReader(instream);
		this.stream = new DataOutputStream(new BufferedOutputStream(outputStream));
		this.TextFlag = textFlag;

		this.record = new ByteArrayOutputStream(RecordLength);
	}

    public static TerseDecompresser create(String inputFileName, String outputFileName, boolean textMode) throws IOException {
        RandomAccessFile inputFile = new RandomAccessFile(inputFileName, "r");
        OutputStream outputStream = new FileOutputStream(outputFileName);
        return create(inputFile, outputStream, textMode);
    }

    public static TerseDecompresser create(RandomAccessFile inputFile, OutputStream outputStream, boolean textMode) throws IOException {
        inputFile.seek(0);
        TerseHeader header = TerseHeader.CheckHeader(new DataInputStream(new RandomAccessFileInputStream(inputFile)));
        inputFile.seek(0);
        return new ParallelTerseDecompresser(inputFile, outputStream, header, textMode);
    }

    public static TerseDecompresser create(DataInputStream inputStream, OutputStream outputStream, boolean textMode) throws IOException {
        TerseHeader header = TerseHeader.CheckHeader(inputStream);

        if (!header.SpackFlag) {
            return new NonSpackDecompresser(inputStream, outputStream, header, textMode);
        } else {
            return new SpackDecompresser(inputStream, outputStream, header, textMode);
        }
    }

    /* Write a new line to the output file*/
    public void endRecord() throws IOException 
    {
    	if (VariableFlag && !TextFlag)
    	{
    		// write a RDW
    		int recordlength = record.size() + 4;
    		int rdw = recordlength << 16;
    		stream.writeInt(rdw);
    	}

    	stream.write(record.toByteArray());
    	record.reset();
    	stream.flush();

    	if (TextFlag)
    	{
    		stream.write(lineseparator);
    		stream.flush();
    	}    		
    }

    /*
     * Write some stuff to the output record
     */

    public void PutChar(int X) throws IOException {
        if (X == 0) {
            if (HostFlag && TextFlag && VariableFlag) {
                endRecord();
            }
        } else {
            if (HostFlag && TextFlag) {
                if (VariableFlag) {
                    if (X == Constants.RECORDMARK) {
                        endRecord();
                    } else {
                    	record.write(Constants.EbcToAsc[X-1]);
                    }
                } else {
                	record.write(Constants.EbcToAsc[X-1]);
                    if (record.size() == RecordLength) {
                        endRecord();
                    }
                }
            } 
            else // This block handles binary mode (HostFlag is false)
            {
                if (X == Constants.RECORDMARK) 
                {
                	/* discard record marks in binary mode */
                }
                else
                {
                	record.write(X-1);
                }
            }
        }
    }

	@Override
	public void close() throws Exception {
		if (TextFlag) {
			endRecord();
		} else if (record.size() > 0) {
			endRecord();
		}
		this.stream.close();
		this.input.close();
	}
}

